def part_1(): 
	with open("2015/day_19/input.txt", "r") as f: 
		trans = [line.strip().split(" => ") for line in f.readlines()]
	s1 = ""
	s = set()
	c=0
	for t in trans: 
		for i in range(len(s1)+1): 
			s2 = ""
			s3 = s2[:i] + s2[i:].replace(t[0], t[1], 1)
			if s3 not in s: 
				c+=1 
			s.add(s3)
	print(len(s))
part_1()